import styled from 'styled-components';
import Background from '../../assets/pattern1.svg';

const Container = styled.div`
  height:100vh;
  width: 100vw;
  background-image: url(${Background});
  background-size: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 10px;
`;


const TextTitle = styled.div`
  width: 265px;
  height: 52px;
  font-family: 'Work Sans'  ;
  font-size: 38px;
  font-weight: 500;
  font-style: normal;
  font-stretch: normal;
  line-height: normal;
  letter-spacing: normal;
  color: #e0c8ff;
  margin-bottom: 28px;
  & > .textshadow {
    text-shadow: -20px -15px 1px rgba(224,200,255,0.1);
  }
  div:last-child{
    width: 128.8px;
    height: 1px;
    background-color: #c789ff;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-left: 10px;
  }
  & > .title {
    font-weight: 600
    span {
      font-wight: 300
    }
  }
`

export {
  Container,
  TextTitle
}
